import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { Navbar } from './Navbar/navbar/navbar';
import { Hero } from './comment/hero/hero';
import { Footer } from './comment/footer/footer';
import { Aboutus } from './comment/aboutus/aboutus';

@Component({
  selector: 'app-root',
  imports: [RouterOutlet, Navbar, Hero, Footer, Aboutus],
  template: `
    <navbar></navbar>
    <hero></hero>
    <router-outlet></router-outlet>
    <about></about>
    <app-footer></app-footer>
  `,
  standalone: true
})
export class App { }
